import { Component } from '@angular/core';

import { products } from '../products';

@Component({
  selector: 'curriculum',
  templateUrl: './curriculum.component.html',
  styleUrls: ['./curriculum.component.css']
})
export class Curriculum {

  share() {
    window.alert('The product has been shared!');
